import "./estilos.css";
import 'bootstrap/dist/css/bootstrap.min.css';

class Informacao extends Component {
    static n = 0;
    constructor(props) {
        super(props);


    }
    render() {
        return (
           <section>

           <button type="button" class="btn btn-primary" data-toggle="modal" data-target="#ModalLongoExemplo">
                Abrir modal de demonstração
            </button>
            <div className="modal fade" id="ModalLongoExemplo" tabindex="-1" role="dialog" aria-labelledby="TituloModalLongoExemplo" aria-hidden="true">
  <div className="modal-dialog" role="document">
    <div className="modal-content">
      <div className="modal-header">
        <h5 className="modal-title" id="TituloModalLongoExemplo">Título do modal</h5>
        <button type="button" className="close" data-dismiss="modal" aria-label="Fechar">
          <span aria-hidden="true">&times;</span>
        </button>
      </div>
      <div className="modal-body">
                            ...
      </div>
      <div className="modal-footer">
        <button type="button" className="btn btn-secondary" data-dismiss="modal">Fechar</button>
        <button type="button" className="btn btn-primary">Salvar mudanças</button>
      </div>
    </div>
  </div>
</div>
           </section>
        )
    }
}

export default Informacao;
